"154922":{"id":"154922","name":"Phat Tuesdays: The Era of Hip Hop Comedy","slug":"phat-tuesdays-the-era-of-hip-hop-comedy","original_title":"Phat Tuesdays: The Era of Hip Hop Comedy","overview":"Nas palavras de Anthony Anderson, Tiffany Haddish, Steve Harvey, Regina King e outros, Phat Tuesdays conta a história de como um homem, Guy Torry, moveu montanhas para lançar uma noite de humor negra na The Comedy Store. O que começou como um experimento na LA dos anos 90 se transformou num terreno fértil para os maiores comediantes de hoje, elevando as vozes negras e lhes dando sua vez no palco.","first_air_date":"2022-02-03","episode_run_time":55,"vote_average":6,"number_of_seasons":1,"number_of_episodes":3,"created_by":[],"production_companies":["Amazon Studios","Original Productions","Phat Tuesday Productions","Grammnet NH Productions"],"genres":["Documentário"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/g019lOXxHyJsHcqpIqYlK1JPoo2.jpg","poster_path":"https://image.tmdb.org/t/p/original/sUcNBXuoTQV0ZUZvmGHiLxgqAJS.jpg","cast":["Guy Torry","Joe Torry","Snoop Dogg","Tiffany Haddish","Kym Whitley"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/sUcNBXuoTQV0ZUZvmGHiLxgqAJS.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/sUcNBXuoTQV0ZUZvmGHiLxgqAJS.jpg","air_date":"2022-02-03","episode_count":3,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Hood para Hollywood","overview":"A história de como os comediantes negros foram excluídos dos clubes de comédia \"brancos\" nos anos 1990 e como encontraram locais no sul de LA, onde Martin Lawrence, D.L. Hughley e Robin Harris mostravam seus talentos. Após os tumultos em LA, o comediante Guy Torry lançou Phat Tuesdays, uma noite de comédia negra na mundialmente famosa The Comedy Store.","air_date":"2022-02-03","runtime":55,"still_path":"https://image.tmdb.org/t/p/original/6X1WQU7iWYDUui1tOqBe4u2g9RD.jpg","vote_average":0},"2":{"name":"É assim que a gente faz","overview":"O Phat Tuesdays se tornou o clube mais badalado de Los Angeles, atraindo superastros como Prince, Magic Johnson e Eddie Murphy, ao mesmo tempo, deu a muitos humoristas, como Nick Cannon, Chris Tucker, Bill Bellamy e o apresentador Guy Torry, grandes oportunidades no cinema e na televisão. Mas o sucesso aumenta a tensão entre Guy Torry e seu irmão mais velho Joe...","air_date":"2022-02-03","runtime":55,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"3":{"name":"Quem é o próximo?","overview":"Phat Tuesdays se tornou um espaço para humoristas mulheres falarem sobre o machismo que enfrentavam. Lendas como Steve Harvey revelam a ciência por trás do que é preciso para ser engraçado. Enquanto isso, uma nova geração de estrelas da comédia é lançada nas redes sociais, e as estrelas do Phat Tuesdays retornam para uma homenagem, incluindo J.B. Smoove, Cedric the Entertainer, Luenell e outros.","air_date":"2022-02-03","runtime":55,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0}}}}},
