"135730":{"id":"135730","name":"Afeto Profundo","slug":"afeto-profundo","original_title":"最愛","overview":"Em 2006, Rio Sanada vivia em um vilarejo onde ocorreu um caso de desaparecimento. Mais tarde, Rio cursou farmácia em uma universidade de Tóquio. Agora, aos 30 anos de idade, ela assume o cargo de CEO da Sanada Wellness, que é uma subsidiária da Sanada Holdings. A mãe de Rio dirige a Sanada Holdings, porém, sua filha recebe a atenção da mídia e do público devido à sua jovem idade como CEO.","first_air_date":"2021-10-15","episode_run_time":59,"vote_average":7,"number_of_seasons":1,"number_of_episodes":10,"created_by":["塚原あゆ子"],"production_companies":["TBS"],"genres":["Drama","Mistério"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/sn1jhmkXm896ScNcNt4lWI5Unbl.jpg","poster_path":"https://image.tmdb.org/t/p/original/f5RbMYxVo78YrWN1U9NBqcFhxwT.jpg","cast":["吉高由里子","松下洸平","井浦新","及川光博","薬師丸ひろ子"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/wqyVczslUwS6YkSru1Qvmn2F133.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/wqyVczslUwS6YkSru1Qvmn2F133.jpg","air_date":"2021-10-15","episode_count":10,"overview":"N/A","vote_average":6,"episodes":{"1":{"name":"Episódio 1","overview":"Daiki se aproxima de Rio, uma estudante que quer fazer faculdade em Tóquio. Até que um evento fatídico afasta os dois.","air_date":"2021-10-15","runtime":58,"still_path":"https://image.tmdb.org/t/p/original/8I4pT89c0Wwkr5kCIVFHqqhlXZJ.jpg","vote_average":0},"2":{"name":"Episódio 2","overview":"Daiki questiona Rio sobre sua ligação com o falecido Akira. No passado, a jovem Rio tem dificuldade para se adaptar à nova situação familiar.","air_date":"2021-10-22","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/rdNMSYlgSVFqYymZS4J8LYpel8P.jpg","vote_average":0},"3":{"name":"Episódio 3","overview":"Rio conta a Daiki sobre a noite do assassinato de Akira. A Sanada BemEstar recebe uma ameaça, mas Rio está determinada a não se abalar com nada.","air_date":"2021-10-29","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/kbmbFa8KaI6PPki2yQcXmycvx9u.jpg","vote_average":0},"4":{"name":"Episódio 4","overview":"Daiki pergunta a Rio sobre um homem suspeito e ouve o álibi de Kase. A publicação de um artigo enganoso na internet causa problemas para Rio na Sanada Bem-Estar.","air_date":"2021-11-05","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/hrI2ePV7tkmZoYnMJIbPf31UxTs.jpg","vote_average":0},"5":{"name":"Episódio 5","overview":"Daiki tenta conseguir informações sobre o passado de um antigo integrante do time de corrida. Uma difícil verdade obriga Rio a tomar uma atitude ousada.","air_date":"2021-11-12","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/bLh3hJ13EjqS3ojb4oMPJkUCUbD.jpg","vote_average":0},"6":{"name":"Episódio 6","overview":"Rio se preocupa com Yu e lida com duras críticas. Ao analisar o vídeo da luta entre Yu e Akira, Kase percebe algo estranho.","air_date":"2021-11-19","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/mpB0v2lQkktYLZDyMwvRAm8uaHC.jpg","vote_average":0},"7":{"name":"Episódio 7","overview":"Enquanto Rio e Yu tentam seguir com suas vidas, Shiori Tachibana investiga incansavelmente o Grupo Sanada.","air_date":"2021-11-26","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/bsH8gTw1iOnwyAdBNyi0fadvJG1.jpg","vote_average":0},"8":{"name":"Episódio 8","overview":"Após encontrar um corpo, Rio tem que dar um depoimento à polícia. Quando as suspeitas recaem sobre Goto, ele desaparece sem deixar vestígios.","air_date":"2021-12-03","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/jM65dpX9McGm6Ly1dKs6tf0Ewo3.jpg","vote_average":0},"9":{"name":"Episódio 9","overview":"A polícia faz progressos na investigação graças à caneta personalizada. Surge um artigo que relaciona o escândalo da doação da Sanada BemEstar ao corpo encontrado.","air_date":"2021-12-10","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/onuuYCt8VFl7WfONpobutLMVfp.jpg","vote_average":0},"10":{"name":"Episódio 10","overview":"Rio precisa tomar uma decisão difícil quando vem à tona a verdade que liga eventos do passado aos assassinatos recentes.","air_date":"2021-12-17","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/es30ddROw8fqyybnlLedU9wTC9m.jpg","vote_average":6}}}}},
