"211565":{"id":"211565","name":"A Última Ficha","slug":"a-ultima-ficha","original_title":"アトムの童","overview":"Nayuta Azumi é um jovem desenvolvedor que cria jogos por conta própria. Ele recebe o apelido de “Banksy dos videogames”, porque ninguém o conhece. Após um certo incidente, ele decide levar uma vida tranquila. Enquanto isso, a Atom Toys, uma fabricante de brinquedos de longa data à beira do colapso, procura desesperadamente por ele enquanto se concentra no desenvolvimento de jogos eletrônicos. Jovens geniais se esforçam para criar uma onda de empolgação, depositando seu orgulho em peças únicas.","first_air_date":"2022-10-16","episode_run_time":0,"vote_average":6.6,"number_of_seasons":1,"number_of_episodes":9,"created_by":["山室大輔","Okamoto Shingo"],"production_companies":["TBS"],"genres":["Drama"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/a7BRkC78viNVGCBfkKClItXQpsC.jpg","poster_path":"https://image.tmdb.org/t/p/original/AqUWbjKEI1CyfS51p1RsEHqxAw1.jpg","cast":["山﨑賢人","松下洸平","岸井ゆきの","オダギリジョー","岡部大"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/AqUWbjKEI1CyfS51p1RsEHqxAw1.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/AqUWbjKEI1CyfS51p1RsEHqxAw1.jpg","air_date":"2022-10-16","episode_count":9,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Fase 1: Não me Menospreze! Entrando na Indústria de Jogos!","overview":"Nayuta Azumi, o misterioso gênio desenvolvedor de jogos \"João-Ninguém\", agora leva uma vida tranquila longe do desenvolvimento de jogos. Enquanto isso, a antiga fabricante de brinquedos Atom Toys está enfrentando uma crise e pode fechar as portas. A Atom procura desesperadamente João-Ninguém para que possam entrar na indústria de jogos eletrônicos e recuperar a empresa.","air_date":"2022-10-16","runtime":69,"still_path":"https://image.tmdb.org/t/p/original/bhh4yPTXSPd7AYu3vFbIzA8YwLi.jpg","vote_average":0},"2":{"name":"Fase 2: O Inimigo é um Ex-melhor Amigo","overview":"A nova Atom Toys está finalmente ativa. Nayuta procura um novo parceiro e Umi o leva a um evento de jogos onde ele encontra Hayato Sugou.","air_date":"2022-10-23","runtime":60,"still_path":"https://image.tmdb.org/t/p/original/kVPZvnYGOz03za0golDTncbkzKn.jpg","vote_average":0},"3":{"name":"Fase 3: O Mensageiro do Banco","overview":"Dez meses se passaram desde que Nayuta e Hayato começaram a criar jogos na Atom Toys. Os personagens criados por Shigeo e sua equipe aparecem cheios de vida na tela do computador. No entanto, Kenyu Oyamada, do Yayoi Bank, de repente exige o pagamento imediato do empréstimo. Com o prazo de um mês, todos os funcionários começam a arrecadar dinheiro. Então, o editor Aki Sagara sugere participar de uma competição de apresentação em larga escala que conecta investidores com criadores de jogos.","air_date":"2022-10-30","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/9yV15J6xmKyclgplqr59LhKobAn.jpg","vote_average":0},"4":{"name":"Fase 4: Tempo Esgotado","overview":"O jogo do Atom estava prestes a ser concluído, mas seus dados foram apagados. Nayuta e Hayato tentam restaurar o jogo rapidamente, mas discutem como proceder. Umi está frustrada com sua incapacidade de controlar tudo. Enquanto isso, Okitsu planeja seu próximo passo.","air_date":"2022-11-06","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/ya8dBmbHklMqvpVgjs7O5CNZ3Fv.jpg","vote_average":0},"5":{"name":"Fase 5: Aquisição Concluída","overview":"Nayuta e seus amigos ficam perdidos quando seu jogo completo é rejeitado pelos sites de distribuição. Eles recebem uma proposta de Okitsu na SAGAS, mas Nayuta e seus amigos se recusam a contar com sua ajuda.","air_date":"2022-11-13","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/4rZatWnx3Txi32nP2pQdQLwNdeC.jpg","vote_average":0},"6":{"name":"Fase 6: Reiniciar","overview":"Um ano se passou desde que a SAGAS adquiriu a Atom Toys. O que passa na mente de Nayuta e dos outros ex-funcionários? Seus pensamentos agora os fazem ir à luta!","air_date":"2022-11-20","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/7pEipzvxdbb2Os8sGcZtFjf0Fzy.jpg","vote_average":0},"7":{"name":"Fase 7: SOS de um Arqui-inimigo","overview":"Vários anos se passaram desde que a Atom Toys mudou seu nome para Última Ficha da Atom e recomeçou. O número de funcionários aumentou e a empresa recuperou sua energia anterior. Nayuta e Hayato conhecem pessoas em um evento para criadores de jogos e começam a visualizar a próxima fase de suas carreiras. Umi, como CEO, tem sentimentos confusos. Enquanto isso, Okitsu sente uma crise iminente quando um grande conglomerado, a Consultoria Familiar Miyazawa, começa a adquirir muitas ações da SAGAS.","air_date":"2022-11-27","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/m8dzXmgpKwhXlhW5w0ABZKXReIi.jpg","vote_average":0},"8":{"name":"Fase 8: Parte Um do Capítulo Final - O Plano para Recuperar a Atom","overview":"Nayuta decide desenvolver um jogo com seu inimigo de longa data, Okitsu, a fim de recuperar a tecnologia da Atom. Ele entra em crise, e Okitsu procura um homem que pode ser sua última esperança.","air_date":"2022-12-04","runtime":46,"still_path":"https://image.tmdb.org/t/p/original/eq31IIFv82awrq2Awh6dMlUAMpq.jpg","vote_average":0},"9":{"name":"Fase Final: Parte Dois do Capítulo Final - O Plano para Recuperar a Atom","overview":"Okitsu é levado pela polícia e a reunião de acionistas da SAGAS vira um caos. Agora que Okitsu não está mais presente, a Consultoria Familiar Miyazawa conquista poderosas procurações que deixam a equipe sem chance de vencer. Em apuros, Nayuta sobe ao palco. Ele lutou ao lado de seus colegas para superar muitas dificuldades em várias situações. Uma grande batalha pelo futuro da indústria de jogos finalmente chega à fase final. Qual lado sairá por cima?","air_date":"2022-12-11","runtime":55,"still_path":"https://image.tmdb.org/t/p/original/iYavQjlJZ2lou5tJgVBM1i5M4Qi.jpg","vote_average":0}}}}},
